import Layout from "common/components/Layout";
import { Container, Fab, Grid } from "@mui/material";
import AddIcon from "@mui/icons-material/Add";

const HomePage = () => {
  return (
    <Layout>
      <Container>
        <Grid container>
          <Grid item sm={2}>
            tes
          </Grid>
          <Grid item sm={10}>
            hello
          </Grid>
        </Grid>
      </Container>

      <Fab color="primary" aria-label="add">
        <AddIcon />
      </Fab>
    </Layout>
  );
};

export default HomePage;
